import { Route, BrowserRouter } from 'react-router-dom';
import { Link } from "react-router-dom/cjs/react-router-dom.min"
import {GetUsersMannager} from "./userListMannager"

export const Mannager=()=>{
    return<>
    <nav>
        {/* <Route path="/users" component={GetUsersMannager}></Route> */}
        <li><Link to ="/users">צפיה במשתמשים</Link></li>
        <li><Link to ="/products">צפיה במוצרים</Link></li>
    </nav>
    </>
}
